import { Redirect } from 'react-router-dom';
import { GetOrder } from '../../Services/DB';
import { type } from 'os';
import { isArray } from 'util';

// let orders = { date, email, item, price, vendor };
class Detail extends Component {

    componentDidUpdate = () => {
        const lastOrder = GetOrder();

        console.log(lastOrder.length)
    }

    render() {
        const { user } = this.props;
        if (user) { return <Redirect to="/" /> };
        return (
            <table className="table container table-striped bg-secondary text-white detail">
                <thead>
                    <tr>
                        <th>Item:</th>
                        <th>Price:</th>
                        <th>Vendor:</th>
                        <th>Date:</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        {/* <td>{order.email}</td>
                        <td>{order.item}</td>
                        <td>{order.price}</td>
                        <td>{order.vendor.title}</td>
                        <td>{order.date}</td> */}
                    </tr>
                </tbody>
            </table>
        )
    }
}

export default Detail;
